Bonnie Lynn Raitt (born November 8, 1949) is an American blues singer-songwriter who was born in Burbank, California. The daughter of Broadway musical star John Raitt, Raitt is best known for her songs &quot;Nick of Time&quot; , &quot;Something to Talk About&quot; and the ballad &quot;I Can&amp;#039;t Make You Love Me&quot;. Raitt married actor Michael O&amp;#039;Keefe in 1991, however divorced in 1999. Raitt is also an avid political activist and has been accoladed nine Grammy Awards in her career.





